var measureStep5Page = function () {
    return this;
};

//初始化
measureStep5Page.prototype.init = function () {
    // 初始化数据测试
    // this.initBase64();

    //初始化事件
    this.initEvent();
    //初始化数据
    this.initData();
};

// 初始化数据测试
measureStep5Page.prototype.initBase64 = function () {
    this.sideFile = "data:image/jpeg;base64,";

    this.positiveFile = "data:image/jpeg;base64,";

};

//初始化数据
measureStep5Page.prototype.initData = function () {
    // 获取链接中的参数
    var avatarId = window.location.search ? window.location.search.split('?')[1].split('=')[1] : "";

    // 如果链接有用户id，则根据用户id获取数据
    if (avatarId) {
        // 根据用户id获取数据
        this.getDataByAvatarid(avatarId);
    }
    else {
        // 根据测量参数获取数据
        this.getDataByParam();
    }
};

// 根据用户id获取数据
measureStep5Page.prototype.getDataByAvatarid = function (id) {
    var that = this;

    // 根据用户id从本地获取数据
    that.data = localStorage.getItem(id);
    if (that.data) {
        that.data = JSON.parse(that.data);

        // 绑定数据
        that.setData();
        // 绑定左侧头像
        that.setAvatarImg();
        // 绑定曲线数据
        that.setCurveImg();
        return;
    }

    // 获取头像接口
    var data = {};
    data.data_id = id;
    var url = commonJs.apiUrl + "/webpillow/detail.html";
    ajax.load(url, data, ajaxFun);

    function ajaxFun(resultData) {
        console.log("根据用户id获取数据: ", resultData);

        // 设置数据
        that.data = resultData.content;
        // 绑定数据
        that.setData();
        // 绑定左侧头像
        that.setAvatarImg();
        // 绑定曲线数据
        that.setCurveImg();
    }
};

// 根据测量参数获取数据
measureStep5Page.prototype.getDataByParam = function () {
    var that = this;

    // 获取数据id，如果存在，则不再进行接口数据获取
    var dataId = localStorage.getItem("cl_data_id");
    if (dataId) {
        // 设置数据
        that.data = JSON.parse(localStorage.getItem(dataId));

        // 绑定数据
        that.setData();
        // 绑定左侧头像
        that.setAvatarImg();
        // 绑定曲线数据
        that.setCurveImg();
        return;
    }

    // var sideFile = this.dataURLToBlob(this.sideFile, 'image/png');
    // var positiveFile = this.dataURLToBlob(this.positiveFile, 'image/png');

    var sideFile = this.dataURLToBlob(localStorage.getItem("sideFile"), 'image/png');
    var positiveFile = this.dataURLToBlob(localStorage.getItem("positiveFile"), 'image/png');

    // var sideFile = this.dataURLToFile(this.sideFile);
    // var positiveFile = this.dataURLToFile(this.positiveFile);


    // 获取头像接口
    // var data = {};
    var formData = new FormData();
    // 设备码
    formData.append("device_sn", commonJs.deviceCode);
    // 性别
    formData.append("gender", localStorage.getItem("measureGender"));
    // 头型
    formData.append("headStyle", localStorage.getItem("measureHair"));
    // 侧面图
    formData.append("sideFile", sideFile, "file_" + Date.parse(new Date()) + ".png");
    // 正面图
    formData.append("positiveFile", positiveFile, "file_" + Date.parse(new Date()) + ".png");

    var request = new XMLHttpRequest();
    request.open("POST", commonJs.apiUrl + "/webpillow/uploadFile.html");
    request.onreadystatechange = function () {
        if (request.readyState == 4) {
            if (request.status == 200) {
                console.log("上传成功");
                console.log("根据测量参数获取数据: ", request.responseText);

                // 转换数据
                var dataJson = JSON.parse(request.responseText);

                // 判断如果没有获取功能则弹出错误数据
                if (dataJson.code != "1000") {
                    // 隐藏等待页面
                    $(".load-model").hide();
                    layer.alert(dataJson.message)
                    // alert(dataJson.message);
                    return;
                }

                // 设置数据
                that.data = dataJson.content;

                // 保存到本地
                localStorage.setItem(that.data.data_id, JSON.stringify(that.data));
                // 保存该条id到本地，返回到上页拍照页后，移除该id
                localStorage.setItem("cl_data_id", that.data.data_id);

                // 绑定数据
                that.setData();
                // 绑定左侧头像
                that.setAvatarImg();
                // 绑定曲线数据
                that.setCurveImg();

            } else {
                console.log("上传失败");
            }
        }
    };
    request.send(formData);
    // $.ajax({
    //     url: commonJs.apiUrl + "/webpillow/uploadFile.html",
    //     type: 'POST',
    //     data: formData,
    //     // contentType: "application/x-www-form-urlencoded",
    //     contentType: undefined,
    //     processData: false,
    //     // mimeType: "multipart/form-data",
    //     // cache: false,
    //     success: function (data) {
    //         //代码
    //         console.log(data)
    //     }
    // });

    return;


    // 获取头像接口
    var data = {};
    // 设备码
    data.device_sn = commonJs.deviceCode;
    // 性别
    data.gender = localStorage.getItem("measureGender");
    // 头型
    data.headStyle = localStorage.getItem("measureHair");
    // 侧面图
    data.sideFile = sideFile;
    // 正面图
    data.positiveFile = positiveFile;

    var url = commonJs.apiUrl + "/webpillow/uploadFile.html";
    ajax.load(url, data, ajaxFun);

    function ajaxFun(resultData) {
        console.log("根据测量参数获取数据: ", resultData);

        // 设置数据
        that.data = resultData.content;
        // 绑定数据
        that.setData();
        // 绑定左侧头像
        that.setAvatarImg();
        // 绑定曲线数据
        that.setCurveImg();
    }
};

// 转换base64为Blob
measureStep5Page.prototype.dataURLToBlob = function (dataURL, type) {
    var binary = atob(dataURL.split(',')[1]);
    var array = [];
    for (var i = 0; i < binary.length; i++) {
        array.push(binary.charCodeAt(i));
    }
    return new Blob([new Uint8Array(array)], {type: type});


    // 解码base64
    // var byteString = atob(dataURL.split(',')[1]);
    // var mimeString = dataURL.split(',')[0].split(':')[1].split(';')[0];
    // // 类型数组
    // var ia = new Uint8Array(byteString.length);
    // for (var i = 0; i < byteString.length; i++) {
    //     ia[i] = byteString.charCodeAt(i);
    // }
    // return new Blob([ia], {
    //     type: mimeString
    // });
}

// 转换base64为文件
measureStep5Page.prototype.dataURLToFile = function (dataURL, filename) {
    var arr = dataURL.split(','), mime = arr[0].match(/:(.*?);/)[1],
        bstr = atob(arr[1]), n = bstr.length, u8arr = new Uint8Array(n);
    while (n--) {
        u8arr[n] = bstr.charCodeAt(n);
    }
    return new File([u8arr], filename, {type: mime});
}

// 绑定右侧数据
measureStep5Page.prototype.setData = function () {
    console.log("a", this.data.ac);

    // 数据为mm，转换为cm
    var ac = Math.round(this.data.ac * 10) / 100;
    var bc = Math.round(this.data.bc * 10) / 100;
    var head_neck = Math.round(this.data.head_neck * 10) / 100;
    var head_shoulder = Math.round(this.data.head_shoulder * 10) / 100;

    //头部高度
    $('#acNum').html(ac + 'cm');
    // 设置ac的偏差，为了让下边的滑动块更精准一些
    ac = (ac >= 1 && ac < 3.5) ? (ac + (1 / ac)) : ac;
    ac = (ac > 8) ? 8 : ac;
    $('#acBar').css("width", (ac - 2) / 6 * 100 + '%');

    //颈部高度
    $('#bcNum').html(bc + 'cm');
    // 设置bc的偏差，为了让下边的滑动块更精准一些
    bc = (bc >= 9 && bc <= 10) ? bc + 0.5 : bc;
    bc = (bc > 11) ? 11 : bc;
    $('#bcBar').css("width", (bc - 3.5) / 8 * 100 + '%');

    //头颈高度差
    $('#headNeckNum').html(head_neck + 'cm');
    $('#headNeckBar').css("width", head_neck / 20 * 100 + '%');

    //头肩距离
    $('#headShoulderNum').html(head_shoulder + 'cm');
    $('#headShoulderBar').css("width", head_shoulder / 35 * 100 + '%');
};

// 绑定左侧头像
measureStep5Page.prototype.setAvatarImg = function () {
    $("#avatarImg").attr('src', commonJs.apiUrl + (this.data.avatar || this.data.avatar_url));
};

// 绑定曲线数据
measureStep5Page.prototype.setCurveImg = function () {
    // 渲染PDF
    this.renderingPDF(commonJs.apiUrl + (this.data.bodyImage || this.data.body_url), "sideImg");
};

// 渲染PDF
measureStep5Page.prototype.renderingPDF = function (fileURL, canvasId) {

    PDFJS.getDocument(fileURL).then(function (pdf) {
        pdf.getPage(1).then(function (page) {

            var scale = 2;
            var viewport = page.getViewport(scale);

            // var desiredWidth = 100;
            // var viewport = page.getViewport({ scale: 1, });
            // var scale = desiredWidth / viewport.width;
            // var scaledViewport = page.getViewport({ scale: scale, });

            //  准备用于渲染的 canvas 元素
            var canvas = document.getElementById(canvasId);
            var context = canvas.getContext('2d');
            // canvas.height = $(".curve-person").height();
            // canvas.width = $(".curve-person").width();
            canvas.height = viewport.height;
            canvas.width = viewport.width;


            // 将 PDF 页面渲染到 canvas 上下文中
            var renderContext = {
                canvasContext: context,
                viewport: viewport
            };
            page.render(renderContext);

            // 左移一些canvas
            $(canvas).css({"transform": "translateX(-" + ((canvas.width - $(".curve-person").width())/2) + "px)"})

            // 隐藏等待页面
            $(".load-model").hide();

        });
    });

};


//初始化事件
measureStep5Page.prototype.initEvent = function () {

};

